import React from 'react';
import ReactDOM from 'react-dom';
import '../index.css';
class Banner extends React.Component{
  constructor(props){
    super(props);
  }
  render(){
    return(
    <header class="site-header" role="banner">
    <div class="site-branding">
      <h1 class="site-title">
        <a href="%PUBLIC_URL%" style={{color: "#34495e" }} rel="home">Jonathan Martinez</a>
      </h1>

    </div>
    <nav id="site-navigation" class="main-navigation" role="navigation">
      <div class="menu-main-container">
        <ul id="primary-menu" class="main-list">
          <li class="menu-item">
            <a>Home</a>
          </li>
          <li class="menu-item">
            <a>Projects</a>
          </li>
          <li class="menu-item">
            <a>CV</a>
          </li>
        </ul>

      </div>
      </nav>
    </header>
  );
  }

}



export default Banner;
